import './App.css';
import bg from "./assets/bg-web.png"
import logo from "./assets/logo.png"

function App() {

  const styles = {
    container: {
      padding: "10em"
    },
    title: {
      color: "#FFF"
    }
  }

  return (
    <div className="App" style={{backgroundImage: `url(${bg})`, backgroundSize: "cover", minHeight: "100vh" }}>
      <div style={styles.container}>
        <div className="header" style={{display: 'flex', flexDirection: "row", alignItems: "center"}}>
            <div>
              <h1 style={styles.title}>FlyFair</h1>
              <img src={logo} height={100}/>
            </div>
        </div>
      </div>
    </div>
  );
}

export default App;
